import React from "react";

export default function Main() {
    return (
    <div className='main'>
       <div className='main__top'>
           <button className='main__left-button' />
           <button className='main__right-button' />
        </div>
        <div className='main__bottom'>
           <button className='main__left-button' />
           <button className='main__right-button' />
        </div>
        <div className='main__picture'>
        </div>
    </div>
    );
}
